import React, { useState, useEffect } from 'react';
const Portfolio = () => {
    const alpha = require('alphavantage')({ key : process.env.REACT_APP_ALPHA_VANTAGE_API_KEY });

    const getValues = () => {
        let microsoft;
        alpha.data.intraday('msft').then(data => {
            microsoft = data;
        });
        return microsoft;
    }

    return (
        <div>
            {getValues()}
        </div>
    );
}
 
export default Portfolio;
